public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }

  VolumePair that = (VolumePair) o;
  return source.equals(that.source) && dest.equals(that.dest);
}
